    summary:
      'Cilantro Lime Fish Tacos is a Mexican main course. This recipe serves 4. One portion of this dish contains around <b>29g of protein</b>, <b>24g of fat</b>, and a total of <b>456 calories</b>. For <b>$2.75 per serving</b>, this recipe <b>covers 20%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista requires lime juice, corn tortillas, chunky salsa, and onions. Only a few people made this recipe, and 4 would say it hit the spot. From preparation to the plate, this recipe takes about <b>45 minutes</b>. It is a good option if you\'re following a <b>pescatarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 81%</b>. This score is super. Try <a href="https://spoonacular.com/recipes/cilantro-lime-fish-tacos-1076346">Cilantro Lime Fish Tacos</a>, <a href="https://spoonacular.com/recipes/cilantro-lime-fish-tacos-1401937">Cilantro Lime Fish Tacos</a>, and <a href="https://spoonacular.com/recipes/cilantro-lime-fish-tacos-1486679">Cilantro Lime Fish Tacos</a> for similar recipes.',
