    summary:
      'If you want to add more <b>American</b> recipes to your recipe box, Green Beans with Garlic Chips might be a recipe you should try. This side dish has <b>178 calories</b>, <b>3g of protein</b>, and <b>13g of fat</b> per serving. This gluten free, lacto ovo vegetarian, and primal recipe serves 4 and costs <b>84 cents per serving</b>. Only a few people made this recipe, and 7 would say it hit the spot. From preparation to the plate, this recipe takes about <b>45 minutes</b>. This recipe from Foodista requires balsamic vinegar, butter, green beans, and olive oil. With a spoonacular <b>score of 43%</b>, this dish is good. If you like this recipe, you might also like recipes such as <a href="https://spoonacular.com/recipes/sauteed-green-beans-with-garlic-chips-395227">Sauteed Green Beans with Garlic Chips</a>, <a href="https://spoonacular.com/recipes/garlic-green-beans-433417">Garlic Green Beans</a>, and <a href="https://spoonacular.com/recipes/garlic-green-beans-32721">Garlic Green Beans</a>.',
