    summary:
      'Rigatoni With Sweet Sausages In Creamy Tomato Sauce takes approximately <b>45 minutes</b> from beginning to end. This recipe serves 4. This main course has <b>922 calories</b>, <b>34g of protein</b>, and <b>40g of fat</b> per serving. For <b>$1.92 per serving</b>, this recipe <b>covers 36%</b> of your daily requirements of vitamins and minerals. 82 people were glad they tried this recipe. A mixture of garlic cloves, onion, butter, and a handful of other ingredients are all it takes to make this recipe so yummy. It is brought to you by Foodista. With a spoonacular <b>score of 91%</b>, this dish is great. If you like this recipe, you might also like recipes such as <a href="https://spoonacular.com/recipes/rigatoni-in-creamy-tomato-sauce-207166">Rigatoni in Creamy Tomato Sauce</a>, <a href="https://spoonacular.com/recipes/one-pan-rigatoni-with-creamy-red-wine-tomato-sauce-821935">One Pan Rigatoni with Creamy Red Wine Tomato Sauce</a>, and <a href="https://spoonacular.com/recipes/creamy-pesto-rigatoni-with-chunky-tomato-vinaigrette-198535">Creamy Pesto Rigatoni with Chunky Tomato Vinaigrette</a>.',
