    summary:
      'Lemony Zucchini Fritters requires about <b>45 minutes</b> from start to finish. One portion of this dish contains approximately <b>30g of protein</b>, <b>24g of fat</b>, and a total of <b>477 calories</b>. This recipe serves 3. For <b>$2.89 per serving</b>, this recipe <b>covers 29%</b> of your daily requirements of vitamins and minerals. If you have parsley, juice of lemon, flour, and a few other ingredients on hand, you can make it. This recipe from Foodista has 2 fans. It works well as a reasonably priced main course. With a spoonacular <b>score of 75%</b>, this dish is solid. Users who liked this recipe also liked <a href="https://spoonacular.com/recipes/lemony-zucchini-fritters-1403049">Lemony Zucchini Fritters</a>, <a href="https://spoonacular.com/recipes/lemony-corn-fritters-woolworths-masterchef-513195">Lemony Corn Fritters {Woolworths/Masterchef}</a>, and <a href="https://spoonacular.com/recipes/lemony-zucchini-with-basil-25123">Lemony Zucchini with Basil</a>.',
