    summary:
      'Corn Chowder with Potatoes, Poblanos, and Smoked Gouda might be a good recipe to expand your hor d\'oeuvre recipe box. For <b>$1.28 per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. One serving contains <b>316 calories</b>, <b>9g of protein</b>, and <b>14g of fat</b>. This recipe serves 6. A few people made this recipe, and 22 would say it hit the spot. From preparation to the plate, this recipe takes around <b>45 minutes</b>. A mixture of potatoes, half-and-half, poblano chiles, and a handful of other ingredients are all it takes to make this recipe so tasty. It is brought to you by Foodista. It is a good option if you\'re following a <b>gluten free and lacto ovo vegetarian</b> diet. Taking all factors into account, this recipe <b>earns a spoonacular score of 51%</b>, which is solid. Similar recipes are <a href="https://spoonacular.com/recipes/smoked-chicken-enchiladas-with-corn-roasted-poblanos-671349">Smoked Chicken Enchiladas with corn & roasted poblanos</a>, <a href="https://spoonacular.com/recipes/smoked-chicken-enchiladas-with-corn-roasted-poblanos-1306757">Smoked Chicken Enchiladas with corn & roasted poblanos</a>, and <a href="https://spoonacular.com/recipes/smoked-gouda-mashed-potatoes-532892">Smoked Gouda Mashed Potatoes</a>.',
