    summary:
      'Lamb In Red Mole Sauce requires about <b>45 minutes</b> from start to finish. Watching your figure? This gluten free recipe has <b>286 calories</b>, <b>4g of protein</b>, and <b>23g of fat</b> per serving. For <b>$1.52 per serving</b>, this recipe <b>covers 15%</b> of your daily requirements of vitamins and minerals. This recipe serves 4. 4 people have made this recipe and would make it again. It works well as an affordable sauce. This recipe from Foodista requires canolan oil, salt, cinnamon, and garlic. All things considered, we decided this recipe <b>deserves a spoonacular score of 49%</b>. This score is good. Similar recipes include <a href="https://spoonacular.com/recipes/lamb-in-red-mole-sauce-16171">Lamb in Red Mole Sauce</a>, <a href="https://spoonacular.com/recipes/rack-of-lamb-mole-with-a-strawberry-balsamic-sauce-427281">Rack of Lamb Mole with a Strawberry, Balsamic Sauce</a>, and <a href="https://spoonacular.com/recipes/little-red-mole-sauce-1508153">Little Red Mole Sauce</a>.',
