      'Strawberry Shortcake with Homemade Donuts might be a good recipe to expand your dessert recipe box. For <b>$1.58 per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains roughly <b>9g of protein</b>, <b>16g of fat</b>, and a total of <b>576 calories</b>. This recipe serves 6. It is perfect for <b>Mother\'s Day</b>. This recipe is liked by 2 foodies and cooks. This recipe from Foodista requires baking powder, salt, milk, and egg yolks. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 32%</b>. This score is rather bad. If you like this recipe, you might also like recipes such as <a href="https://spoonacular.com/recipes/miss-shortcake-donuts-strawberry-shortcake-1100250">MISS SHORTCAKE DONUTS (STRAWBERRY SHORTCAKE)</a>, <a href="https://spoonacular.com/recipes/homemade-strawberry-shortcake-377177">Homemade Strawberry Shortcake</a>, and <a href="https://spoonacular.com/recipes/homemade-strawberry-shortcake-1011388">Homemade Strawberry Shortcake</a>.',
