    instructions:
      "<ol><li>Mix cake flour, baking powder and salt together.  I don't like nutmeg so much, but if you do add it now!  Set aside.</li><li>In your mixer, blend the Shortening (I used plain Crisco) and sugar together on low speed until \"sandy\".</li><li>Now blend in the egg yolks on low speed about 1 minute.</li><li>Alternate mixing in your dry ingredients (the flour combo) and the sour cream.  Be sure to scrape down the sides every now and then too.</li><li>Add the vanilla extract last and mix until incorporated.</li><li>Cover the batter and let sit in the fridge for 15-20 minutes.</li><li>Preheat your oven to 350.  Spoon your batter into a ziplock bag to use the corner as a piping bag.  It's a lot easier this way I promise!  Pipe dough into a greased donut pan.</li><li>Bake for 10-12 minutes.</li><li>While baking, prepare the icing for the donuts.  In a saucepan over low heat warm the milk and then whisk in the confectioners sugar until smooth.  That's it!</li><li>Dip the slightly cool donuts in the icing or spoon icing over the top, whatever works for you.</li><li>Now to go completely wild, cut the donut in half (like an english muffin).  Slice up some strawberries and add some whip cream.</li><li>Pure bliss.</li><li>These donuts are super light and airy.  The strawberries and whip cream just go perfectly, it's borderline life changing.</li></ol>",
